//depends: core/views/main.js

hs.views.fields = new Object();

hs.views.fields.byType = new Object();
hs.views.fields.reg = function(){
  var args = _.toArray(arguments);
  var view = args.pop();
  _.each(args, function(arg){
    hs.views.fields.byType[arg] = view;
  });
  return view;
};

hs.views.fields.Field = hs.views.View.extend({
  prepContext: function(){
    return this.options;
  },
  _configure: function(){
    hs.views.View.prototype._configure.apply(this, arguments);
    if (this.options.name) this.name = this.options.name;
  },
  isValid: function(){
    return (!this.options.required || !_.isUndefined(this.get()));
  },
  get: function(){
    return $(this.el).val();
  },
  set: function(value){
    $(this.el).val(value);
  }
});

hs.views.fields.reg('text', 'password', 'email', hs.views.fields.Field.extend({
  template: 'form_input'
}));

hs.views.fields.reg('textarea', hs.views.fields.Field.extend({
  template: 'form_textarea'
}));

hs.views.fields.reg('image_capture', hs.views.fields.Field.extend({
  template: 'form_capture',
  events: {
    'click .take': 'take'
  },
  fakeImage: '',
  take: function(e){
    e.preventDefault();
    if (_.isUndefined(navigator.camera))
      return this.set(this.fakeImage);

    navigator.camera.getPicture(_.bind(function(image){
      //success
      this.set(image);
    }, this), function(){
      //fail
      hs.error('cam error', arguments);
    }, {quality: 50});
  },
  set: function(value){
    this.image = value;
    this.$('img').attr('src', 'data:image/jpeg;base64,'+value);
    this.$('.take').attr('value', 'Retake');
    this.$('.placeheld').remove();
  },
  get: function(){
    return this.image;
  },
  isValid: function(){
    return (!this.options.required || !_.isUndefined(this.image));
  }
}));
